import random
import numpy as np
from scipy.stats import lognorm, norm

# Define functions to generate each feature based on their statistical properties
def generate_target_thickness():
    return np.exp(np.log(1.02) + 0.5 * np.sqrt(16.9) * np.random.standard_normal())

def generate_pulse_width():
    return norm.rvs(loc=300, scale=np.sqrt(1030000))

def generate_energy():
    return np.exp(np.log(13.9) + 0.5 * np.sqrt(2350) * np.random.standard_normal())

def generate_spot_size():
    return norm.rvs(loc=3.61, scale=np.sqrt(13.7))

def generate_intensity():
    return np.exp(np.log(5.10e20) + 0.5 * np.sqrt(3.96e41) * np.random.standard_normal())

def generate_power():
    return np.exp(np.log(6.23e13) + 0.5 * np.sqrt(4.03e27) * np.random.standard_normal())

def generate_cutoff_energy():
    return norm.rvs(loc=8.64, scale=np.sqrt(156))

data = []
for i in range(25):
    target_material = 'Material_' + str(i)
    thickness = generate_target_thickness()
    pulse_width = generate_pulse_width()
    energy = generate_energy()
    spot_size = generate_spot_size()
    intensity = generate_intensity()
    power = generate_power()
    cutoff_energy = generate_cutoff_energy()
    data.append([target_material, thickness, pulse_width, energy, spot_size, intensity, power, cutoff_energy])

print(data)
